import React, { useState } from 'react';

import { QuantitySelector } from "./components/QuantitySelector"

import { megapack, megapack_2, megapack_xl, powerpack } from './assets'; 

import './App.css';

const data = [{
  name: "MegapackXL",
  cost: "$120,000",
  energy: "4 MWh",
  totalCost:"$1567,000",
  totalEnergy: "8MWH",
}, {
  name: "Megapack2",
  cost: "$80,000",
  energy: "3 MWh",
  totalCost:"$1567,000",
  totalEnergy: "8MWH",
},
{
  name: "Megapack",
  cost: "$50,000",
  energy: "2 MWh",
  totalCost:"$1567,000",
  totalEnergy: "8MWH",
},
{
  name: "Powerpack",
  cost: "$10,000",
  energy: "1 MWh",
  totalCost:"$1567,000",
  totalEnergy: "8MWH",
},
{
  name: "Transformer",
  cost: "$10,000",
  energy: "-0.5 MWh",
  totalCost:"$1567,000",
  totalEnergy: "8MWH",
},
]


const DraggableItem = ({ item, onDragStart }) => {
  return (
    <div
      draggable
      onDragStart={(e) => onDragStart(e, item)}
      style={{ padding: '8px', margin: '4px', border: '1px solid #ccc', background: '#f0f0f0' }}
    >
      {item}
    </div>
  );
};

const DropZone = ({ items, onDrop }) => {
  const handleDrop = (e) => {
    e.preventDefault();
    const item = e.dataTransfer.getData('text');
    onDrop(item);
  };

  const handleDragOver = (e) => {
    e.preventDefault();
  };

  return (
    <div
      onDrop={handleDrop}
      onDragOver={handleDragOver}
      style={{ minHeight: '150px', padding: '10px', border: '2px dashed #ccc', background: '#fafafa' }}
    >
      {items.map((item, index) => (
        <DraggableItem key={index} item={item} onDragStart={(e, item) => e.dataTransfer.setData('text', item)} />
      ))}
    </div>
  );
};


function App() {
  console.log("hirtd")

  const [list1, setList1] = useState(['Item 1', 'Item 2', 'Item 3']);
  const [list2, setList2] = useState(['Item 4', 'Item 5']);

  const handleDropInList1 = (item) => {
    setList1([...list1, item]);
    setList2(list2.filter((i) => i !== item));
  };

  const handleDropInList2 = (item) => {
    setList2([...list2, item]);
    setList1(list1.filter((i) => i !== item));
  };


  return (
    <div className="App">
      <h1>Battery Configurator</h1>
      <div className="dashboard">
      <table className="table">
        <thead>
          <tr>
            <th>Battery Type</th>
            <th>Cost/Unit</th>
            <th>Energy/Unit</th>
            <th>Quantity</th>
            <th>Total Cost</th>
            <th>Total Energy</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td>{item.name}
              {/* <img src={megapack_xl} alt="Description of the image" /> */}
              </td>
              <td>{item.cost}</td>
              <td>{item.energy}</td>
              <td>{<div className="quantity-selector">
              <input aria-label="quantity count" max="1000" min="0" type="number" value={2}/>
            </div>}</td>
              <td>{item.totalCost}</td>
              <td>{item.totalEnergy}</td>
            </tr>
          ))}
        </tbody>
      </table>
      </div>
      <div>
      <DropZone items={list1} onDrop={handleDropInList2} />
      <DropZone items={list2} onDrop={handleDropInList1} />
      </div>
      {/* <QuantitySelector /> */}
    </div>
  );
}

export default App;
